import './Leatic.css';

import { Container } from 'react-bootstrap';

function Leatic(){
    return(
        <Container fluid>
            <div className = "leatic">
                <h3 className = "leatic__uptitle">Home Decor</h3>
            </div>
        </Container>
    )
}

export default Leatic;
